        public BaseChart createChart() {

            final StockChart chart = new StockChart()
                .setType(
                    Series.Type.LINE
                )
                .setLinePlotOptions(
                   new LinePlotOptions()
                       .setCompare(LinePlotOptions.Compare.PERCENT)
                )
                .setToolTip(
                    new ToolTip()
                        .setPointFormat("<span style=\"color:{series.color}\">{series.name}</span>: <b>{point.y}</b> ({point.change}%)<br/>")
                        .setValueDecimals(2)
                )
                .setRangeSelector(
                    new RangeSelector()
                        .setSelected(4)
                )
            ;

            YAxis yAxis = chart.getYAxis();
            yAxis.setPlotLines(
                yAxis.createPlotLine()
                    .setValue(0)
                    .setWidth(2)
                    .setColor("silver")
            )
                .setLabels(
                    new YAxisLabels()
                        .setFormatter(
                            new AxisLabelsFormatter() {
                                public String format(AxisLabelsData axisLabelsData) {
                                    return (axisLabelsData.getValueAsLong() > 0 ? "+" : "") + axisLabelsData.getValueAsLong() + "%";
                                }
                            }
                        )
                )
            ;

            chart.addSeries(
                chart.createSeries()
                    .setName("AAPL")
                    .setPoints(getAAPLData())
            )
                .addSeries(
                    chart.createSeries()
                        .setName("GOOG")
                        .setPoints(getGOOGData())
                )
                .addSeries(
                    chart.createSeries()
                        .setName("MSFT")
                        .setPoints(getMSFTData())
                    )
            ;

            return chart;
        }

        static final DateTimeFormat dateTimeFormat = DateTimeFormat.getFormat("yyyy-MM-dd");

        private static long t(int year, int month, int day) {
            return dateTimeFormat.parse(year + "-" + (month + 1) + "-" + day).getTime();
        }
